import styled from 'styled-components';
import TextBox from '../common/TextBox';

function TopArea({ title, desc }) {
    const textContents = {
        title: 'A Simple',
        desc: 'A clean and simple',
    };

    return (
        <TopSection>
            <TextBox title={'A Simple'} desc={desc} />
        </TopSection>
    );
}

const TopSection = styled.div`
    display: flex;
`;

export default TopArea;
